import logo from './logo.svg';
import './App.css';
import * as React from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

async function getData(ID)
{
  var response = await fetch("../../data/api/"+ID+"/api.json").then((response) => response.json())
  var spec_response = await fetch("../../data/api/"+ID+"/species.json").then((response) => response.json())
  this.data = response;
  this.spec_data = spec_response;
  return [this.data, this.spec_data];
}


async function App() {
  var data = []
  for(var i = 0; i < 10; i++)
  {
    data.push((await getData(i)));
  }
  console.log(data);
  return (
    <div className="App">
      
      <h1 style={{textAlign: "center"}}>JSDex</h1>
      <body>
        <Grid container spacing={2}>
          {Array.from(Array(30)).map((_, index) => (
            <Grid item xs={2} sm={4} md={4} key={index}>
              <Item>xs={data[3][0].name}</Item>
              </Grid>
            ))}
        </Grid>
      </body>
    </div>
  );
}

export default App;
